import React from "react";
import "./BlogCard.css";

function BlogCard(props) {
    return (
        <div className="reddit-post" onClick={() => window.open(props.url, "_blank")}>
        <div className="reddit-post__title">{props.title}</div>
        <div className="reddit-post__author">{props.author}</div>
        <div className="reddit-post__score">{props.score} points</div>
        <div className="reddit-post__subreddit">r/{props.subreddit}</div>
        {props.thumbnail && (
          <img className="reddit-post__thumbnail" src={props.thumbnail} alt="" />
        )}
      </div>
    );
}

export default BlogCard;
